import itertools; import math; import operator; import random; from bisect import *; from collections import deque, defaultdict, Counter, OrderedDict; from functools import reduce; from heapq import *; import unittest; from typing import List; import functools
def get_sol(): return Solution()
class Solution:
    # tle
    def longestDupSubstring(self, s: str) -> str:
        def valid(length):
            count=Counter()
            li=deque()
            for i in range(length - 1):
                li.append(s[i])
            for i in range(length - 1, len(s)):
                li.append(s[i])
                tmp=''.join(li)
                count[tmp]+=1
                if count[tmp]>1:
                    return i-length+1
                li.popleft()
            return -1

        lo,hi=0,len(s)
        while lo<=hi:
            mid=(lo+hi)//2
            if valid(mid)!=-1:
                lo=mid+1
            else:
                hi=mid-1

        length=lo-1
        pos = valid(length)
        return s[pos:pos+length]


